import React from "react";

function FazerReserva(){

    const Cadastrar = async ()  => {
        let locatario = document.getElementById("locatario").value
        let data = document.getElementById("data").value
        let sala = document.getElementById("sala").value


        try{
            axios.post('http://127.0.0.1:8000/reservas/', {
            locatario:locatario,
            data : data,
            sala : sala,
          })
          .then(function (response) {
         console.log('foi')
          })
        }catch(error){
            console.log(error)
        }
    }
    return(
        <div className="main">
            <div className='div_cadastro'>
                <h3>Tela de Cadastro de Reserva</h3>
                <input placeholder="sala" id="sala"></input>
                <input placeholder="data" id="data"></input>
                <input placeholder="locatario" type="number" id="locatario"></input>
                
                <button onClick={()=>Cadastrar()}>
                    Cadastrar
                </button>
            </div>
        </div>
    )


}export default FazerReserva
